import React from 'react';

const Header = () => (
  <header>
    <h1>GameHub</h1>
    <nav>
      <a href="#services">Services</a>
      <a href="#games">Games</a>
      <a href="#blogs">Blogs</a>
      <a href="#about">About Us</a>
      <a href="#contact">Contact</a>
    </nav>
  </header>
);

export default Header;
